import numpy as np


def get_vrange(cut_off, conv_width=None):
    nt_dist = np.array(list(error_term_dict_no_constant.values()))
    limits = (list(error_term_dict_no_constant.keys())[0], list(error_term_dict_no_constant.keys())[-1])
    if conv_width is not None:
        conv_dist = np.empty(conv_width*2+1)
        conv_dist.fill(1/(conv_width*2+1))
        nt_dist_noisy = np.convolve(nt_dist, conv_dist)
        limits = (limits[0]-conv_width, limits[1]+conv_width)
    else:
        nt_dist_noisy = nt_dist
    nt_dist_noisy_keys = np.arange(limits[0], limits[1]+1)
    nt_dist_res = list(zip(nt_dist_noisy_keys[nt_dist_noisy > cut_off], nt_dist_noisy[nt_dist_noisy > cut_off]))
    return nt_dist_res


def get_vrange_limits(cut_off, conv_width=None):
    nt_dist_res = get_vrange(cut_off=cut_off, conv_width=conv_width)
    limits = nt_dist_res[0][0], nt_dist_res[-1][0]
    return limits


