# Old stuff, kept for testing

def build_uniform_law(k):
    """ Construct the bounded uniform law as a dictionnary
    :param k: (integer)
    :returns: A dictionary {x:p_k(x) for x in {-k..k}}
    """
    D = {}
    p_i = 1/(2*k+1)
    for i in range(-k, k+1):
        D[i] = p_i
    return D

# Taken from Kyber security estimates


def law_convolution(A, B):
    """ Construct the convolution of two laws (sum of independent variables from two input laws)
    :param A: first input law (dictionnary)
    :param B: second input law (dictionnary)
    """

    C = {}
    for a in A:
        for b in B:
            c = a+b
            C[c] = C.get(c, 0) + A[a] * B[b]
    return C


def old_vrange(cut_off, conv_width):
    conv_dist = build_uniform_law(conv_width)
    noise_dist = law_convolution(error_term_dict_no_constant, conv_dist)
    vrange = [(v, noise_dist[v]) for v in noise_dist if noise_dist[v] >= cut_off]
    return vrange


